import React from "react";
import "../App.css";
import HomeApi from "./cardsList/HomeApi";
import SellerForm from "./sellingForm/SellerForm"
import Item from "./itemView/Item";
import WatchApi from "./watchList/WatchApi";
import BasketApi from './basket/BasketApi'
import Register from "./users/Register";
import Login from "./users/Login";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import NavBar from "./nav/NavBar";


function App() {
  return (
    <Router>
      <Switch>

          <Route path="/sellerForm">
          <SellerForm/>
          </Route>
        <Route path="/" exact>
          <NavBar/>
          <HomeApi/>
        </Route>
        <Route path="/item/:id">
          <Item/>
        </Route>
        <Route path="/watchList">
          <WatchApi/>
        </Route>
        <Route path="/basketList">
          <BasketApi/>
        </Route>
        <Route path="/register">
          <Register/>
        </Route>
        <Route path="/login">
          <Login/>
      </Route>
        </Switch>
      </Router>
  );
}

export default App;
